import React, { useState, useEffect, useCallback } from 'react';

const SLIDE_DURATION = 5000; // 5 seconds per slide

const ProgressBar = ({ duration, isPaused, onComplete, key }) => {
  const [progress, setProgress] = useState(0);

  useEffect(() => {
    if (isPaused) return;

    const startTime = Date.now();
    const interval = setInterval(() => {
      const elapsedTime = Date.now() - startTime;
      const newProgress = (elapsedTime / duration) * 100;

      if (newProgress >= 100) {
        clearInterval(interval);
        setProgress(100);
        onComplete();
      } else {
        setProgress(newProgress);
      }
    }, 16); // ~60fps

    return () => clearInterval(interval);
  }, [duration, isPaused, onComplete]);

  return (
    <div className="absolute top-0 left-0 right-0 z-50">
      <div className="h-1 w-full bg-gray-600/30">
        <div
          className="h-full bg-white transition-all duration-100 ease-linear"
          style={{ width: `${progress}%` }}
        />
      </div>
    </div>
  );
};

const ImageSlide = ({ image, onNext, isPaused, setIsPaused }) => {
  const [touchStartTime, setTouchStartTime] = useState(null);

  const handleTouchStart = useCallback(() => {
    setTouchStartTime(Date.now());
    setIsPaused(true);
  }, [setIsPaused]);

  const handleTouchEnd = useCallback(() => {
    const touchDuration = Date.now() - touchStartTime;
    setIsPaused(false);

    // If touch duration is less than 200ms, consider it a tap
    if (touchDuration < 200) {
      onNext();
    }
  }, [touchStartTime, onNext, setIsPaused]);

  return (
    <div 
      className="relative w-full h-full bg-black"
      onTouchStart={handleTouchStart}
      onTouchEnd={handleTouchEnd}
      onMouseDown={handleTouchStart}
      onMouseUp={handleTouchEnd}
    >
      <img 
        src={image} 
        alt="Wrapped moment"
        className="w-full h-full object-contain"
      />
      <div className="absolute bottom-6 left-0 right-0 text-center text-white text-sm opacity-70">
        Tap to skip â€¢ Hold to pause
      </div>
    </div>
  );
};

const Wrapper = ({ images }) => {
  const [currentIndex, setCurrentIndex] = useState(0);
  const [isPaused, setIsPaused] = useState(false);
  const [isComplete, setIsComplete] = useState(false);

  const handleNext = useCallback(() => {
    if (currentIndex < images.length - 1) {
      setCurrentIndex(prev => prev + 1);
    } else {
      setIsComplete(true);
    }
  }, [currentIndex, images.length]);

  if (isComplete) {
    return (
      <div className="flex items-center justify-center h-full bg-black text-white">
        <div className="text-center p-8">
          <h2 className="text-2xl font-bold mb-4">Thanks for watching!</h2>
          <button 
            onClick={() => {
              setCurrentIndex(0);
              setIsComplete(false);
            }}
            className="px-6 py-2 bg-white text-black rounded-full hover:bg-gray-200 transition-colors"
          >
            Watch Again
          </button>
        </div>
      </div>
    );
  }

  return (
    <div className="relative h-full">
      <ProgressBar
        key={currentIndex}
        duration={SLIDE_DURATION}
        isPaused={isPaused}
        onComplete={handleNext}
      />
      <ImageSlide
        image={images[currentIndex]}
        onNext={handleNext}
        isPaused={isPaused}
        setIsPaused={setIsPaused}
      />
      <div className="absolute top-4 left-4 right-4 z-50 flex justify-between">
        <div className="w-full flex gap-1">
          {images.map((_, idx) => (
            <div
              key={idx}
              className="flex-1 h-1 rounded-full transition-all duration-300"
              style={{
                backgroundColor: idx === currentIndex ? 'white' : 'rgba(255,255,255,0.3)'
              }}
            />
          ))}
        </div>
      </div>
    </div>
  );
};

const WrappedApp = () => {
  return (
    <div className="fixed inset-0 bg-black">
      <div className="mx-auto h-full max-w-[430px] bg-black relative">
        <Wrapper
          images={[
            '/images/1.png',
            '/images/2.png',
            '/images/3.png',
            '/images/4.png',
            '/images/5.png',
            '/images/6.png',
            '/images/7.png',
            '/images/8.png',
            '/images/9.png',
            '/images/10.png',
            '/images/11.png',
            '/images/12.png',
          ]}
        />
      </div>
    </div>
  );
};

export default WrappedApp;
